      "/all-parts/Power Retractable Hardtop-a.swf",
      "/all-parts/Power Retractable Hardtop-b.swf",
      "/all-parts/Power Retractable Hardtop-c.swf",
      "/all-parts/Power Window System (Hard top).swf",
      "/all-parts/Power Window System (Soft top).swf",
      "/all-parts/Rear Window Defroster.swf",
      "/all-parts/Seat Warmer.swf",
      "/all-parts/Starting System.swf",
      "/all-parts/Trunk Compartment Light.swf",
      "/all-parts/Trunk Lid Opener.swf",
      "/all-parts/Turn And Hazard Warning Light.swf",
      "/all-parts/Wiper And Washer.swf",

    ]
    function showIt(which, index) {
      const foundPart = document.querySelector('.' + which)
      const foundUrl = allParts[index]
      const newTemplate = `<object width="100%" height="100%">
      <param name="movie" value="${foundUrl}">
      <param name="quality" value="high">
      <embed src="${foundUrl}" quality="high" type="application/x-shockwave-flash" width="100%"
        height="100%" swLiveConnect=true></embed>
    </object>`
      if (foundPart) {
        if (foundPart.classList.contains('open-swf')) {
          foundPart.innerHTML = foundPart.innerHTML.split('<ruffle-object')[0]
          foundPart.classList.remove('open-swf')
        } else if (!foundPart.innerHTML.includes('-object')) {
          foundPart.innerHTML = foundPart.innerHTML + newTemplate
          foundPart.classList.add('open-swf')
        }

      }

    }
    const foundBoi = document.querySelector('#choices')
    allParts.forEach((part, ind) => {
      const className = part.split('/').pop()
      const fullName = className.split(' ').join('-').split('.').join('--')
      const template = `
    <h2>"${className}"</h2>
    <button onClick="showIt('${fullName}', ${ind})">toggle schematic</button>
 `
      const divMade = document.createElement('div')
      divMade.classList.add('single-item')
      divMade.classList.add(fullName)
      divMade.innerHTML = template
      foundBoi.appendChild(
        divMade
      )

    })
  </script>
</body>
